-  n ~ 1   dp  
- `dp[i] = i         `
- **** : `{java} dp[i] = max(maxValue, p[i] + dp[i + t[i]])` 
	- `maxValue` :      
- `int[] dp = new int[n + 2]`   n + 1           0 
- `day > n + 1`       `maxValue`  
	-  `0`  `maxValue`   

###  
```java
import java.util.*;
import java.io.*;

public class Main {

    private static StringBuilder sb = new StringBuilder();
    private static InputProcessor inputProcessor = new InputProcessor();

    public static void main(String[] args) {
        input();
        pro();
        output();
    }

    private static int n;
    private static int[][] schedule;

    private static void input() {
        n = inputProcessor.nextInt();

        schedule = new int[n + 1][2]; // 0 : T, 1 : P
        for(int i = 1; i <= n; i++) {
            int t = inputProcessor.nextInt();
            int p = inputProcessor.nextInt();

            schedule[i][0] = t;
            schedule[i][1] = p;
        }
    }

    private static void pro() {
        int[] dp = new int[n + 2]; // n + 1    

        int maxCost = 0;
        for(int i = n; i >= 1; i--) {
            int day = i + schedule[i][0];
            if(day <= n + 1) {
                dp[i] = Math.max(maxCost, dp[day] + schedule[i][1]);
                maxCost = dp[i];
            } else {
                dp[i] = maxCost;
            }
        }

        int result = 0;
        for(int i = 1; i <= n; i++) {
            if(result < dp[i]) {
                result = dp[i];
            }
        }

        sb.append(result);
    }

    private static void output() {
        try (BufferedWriter bw = new BufferedWriter(new OutputStreamWriter(System.out))) {
            bw.write(sb.toString());
            bw.flush();
        } catch (IOException e) {
            throw new RuntimeException(e);
        }
    }

    private static class InputProcessor {
        private BufferedReader br;
        private StringTokenizer st;

        public InputProcessor() {
            this.br = new BufferedReader(new InputStreamReader(System.in));
        }

        public String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
            }

            return st.nextToken();
        }

        public String nextLine() {
            String result = "";

            try {
                result = br.readLine();
            } catch (IOException e) {
                throw new RuntimeException(e);
            }

            return result;
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }

        public long nextLong() {
            return Long.parseLong(next());
        }
    }

}
