###  
-  
- **** : `{java} dp[row][col] += max(leftUp, max(left, leftDown)` 
	- `row = 1`   `leftUp = 0`
	- `row = n`   `leftDown = 0`

###  
```java
import java.util.*;
import java.io.*;

public class Main {

	private static StringBuilder sb = new StringBuilder();  
	private static InputProcessor inputProcessor = new InputProcessor();  

	public static void main(String[] args) {  
	    input();  
	    output();  
	}  

	private static int n, m;  
	private static int[][] dp;  

	private static void input() {  
	    int T = inputProcessor.nextInt();  
	    while(T > 0) {  
	        n = inputProcessor.nextInt(); //   
	        m = inputProcessor.nextInt(); //   

	        dp = new int[n + 1][m + 1];  
	        for(int i = 1; i <= n; i++) {  
	            for(int j = 1; j <= m; j++) {  
	                dp[i][j] = inputProcessor.nextInt();  
	            }  
	        }  

	        pro();  

	        T -= 1;  
	    }  
	}  

	private static void pro() {  
	    //          
	    for(int col = 2; col <= m; col++) {  
	        for(int row = 1; row <= n; row++) {  
	            int leftUp = 0;  
	            if(row != 1) {  
	                leftUp = dp[row - 1][col - 1];  
	            }  

	            int left = dp[row][col - 1];  

	            int leftDown = 0;  
	            if(row != n) {  
	                leftDown = dp[row + 1][col - 1];  
	            }  

	            dp[row][col] 
	            += Math.max(leftUp, Math.max(left, leftDown));  
	        }  
	    }  


	    int result = 0;  
	    for(int i = 1; i <= n; i++) {  
	        //           
	        result = Math.max(result, dp[i][m]); 
	    }  

	    sb.append(result).append("\n");  
	}  

	private static void output() {  
	    try (BufferedWriter bw = new BufferedWriter(new OutputStreamWriter(System.out))) {  
	        bw.write(sb.toString());  
	        bw.flush();  
	    } catch (IOException e) {  
	        throw new RuntimeException(e);  
	    }  
	}  

	private static class InputProcessor {  
	    private BufferedReader br;  
	    private StringTokenizer st;  

	    public InputProcessor() {  
	        this.br = new BufferedReader(new InputStreamReader(System.in));  
	    }  

	    public String next() {  
	        while (st == null || !st.hasMoreElements()) {  
	            try {  
	                st = new StringTokenizer(br.readLine());  
	            } catch (IOException e) {  
	                throw new RuntimeException(e);  
	            }  
	        }  

	        return st.nextToken();  
	    }  

	    public String nextLine() {  
	        String result = "";  

	        try {  
	            result = br.readLine();  
	        } catch (IOException e) {  
	            throw new RuntimeException(e);  
	        }  

	        return result;  
	    }  

	    public int nextInt() {  
	        return Integer.parseInt(next());  
	    }  

	    public long nextLong() {  
