        for(int i = 1; i <= row; i++) {
            for(int j = 1; j <= col; j++) {
                newBoard[i][j] = board[i - 1][j - 1];
            }
        }

        Deque<Robot> que = new ArrayDeque<>();
        Robot start = new Robot(1, 1, 1, 2, 0);
        que.add(start);

        Set<Robot> visited = new HashSet<>();
        visited.add(start);

        int answer = -1;
        while(!que.isEmpty()) {
            Robot cur = que.poll();

            if(cur.isFinish(row, col)) {
                answer = cur.dist;
                break; 
