        if(s.length() < len) { //  
            sb.append(s);
            return sb.toString();
        }

        String pre = s.substring(0, len);
        String post = s.substring(len);

        // 
        if(post.startsWith(pre)) {
            return rec(post, len, repeat + 1); //      
        }

        //  
        if(repeat == 1) sb.append(pre);
        else sb.append(repeat).append(pre);

        return rec(post, len, 1);
    }
