class Solution {
    private int[][] _key;
    private int[][] _lock;

    public boolean solution(int[][] key, int[][] lock) {
        _key = key;
        _lock = lock;
        int m = key.length; // key : m * m
        int n = lock.length; // lock : n * n

        boolean answer = false;
        loop1 :
        for(int i = 0; i < 4; i++) {

            // 
            for(int x = -40; x <= 40; x++) {
                for(int y = -40; y <= 40; y++) {
                    //   
                    pushKey(x, y, m, n);

                    if(unlock(n)) { //    1
                        answer = true;
                        break loop1;
                    }

                    //   
                    pollKey(x, y, m, n);
                }
            }

            if(i < 3) {
                _key = rotate(_key, m); // 
            }
        }

        return answer;
    }

    private void pushKey(int x, int y, int m, int n) {
        for(int row = 0; row < m; row++) {
            for(int col = 0; col < m; col++) {
                int dx = row + x;
                int dy = col + y;

                //    
                if(dx < 0 || dy < 0 || dx >= n || dy >= n) continue;

                _lock[dx][dy] += _key[row][col];
            }
        }
    }

    private boolean unlock(int n) {
        for(int i = 0; i < n; i++) {
            for(int j = 0; j < n; j++) {
                if(_lock[i][j] != 1) return false;
            }
        }

        return true;
    }

    private void pollKey(int x, int y, int m, int n) {
        for(int row = 0; row < m; row++) {
            for(int col = 0; col < m; col++) {
                int dx = row + x;
                int dy = col + y;

                //    
                if(dx < 0 || dy < 0 || dx >= n || dy >= n) continue;

                _lock[dx][dy] -= _key[row][col];
            }
        }
    }

    private int[][] rotate(int[][] key, int m) {
        int[][] temp = new int[m][m];
        for(int i = 0; i < m; i++) {
            for(int j = 0; j < m; j++) {
                temp[i][j] = key[m - j - 1][i];
            }
        }

        return temp;
    }
}
