    private static void pro() {
        Arrays.sort(DATA, 1, N + 1);

        int result = 0;
        int L = 1;
        int R = DATA[N] + 1;

        while(L <= R) {
            int d = (L + R) / 2;

            if(isPossible(d, C)) {
